function Task() {

    return (

        <div style={{ width: '100%', height: '100%', position: 'relative' }}>
            <div style={{ width: 200, height: 610, left: 0, top: 0, position: 'absolute', background: '#EBEBEB', borderRadius: 10 }} />
            <div style={{ width: 46, height: 46, left: 40, top: 37, position: 'absolute' }}>
                <div style={{ width: 46, height: 46, left: 0, top: 0, position: 'absolute', borderRadius: 6, border: '1px black solid' }} />
            </div>
            <div style={{ width: 450, height: 529, left: 110, top: 58, position: 'absolute', color: 'black', fontSize: 22, fontFamily: 'SF Pro Display', fontWeight: '400', wordWrap: 'break-word' }}>Deploy Automation</div>
            <div style={{ width: 450, height: 513, left: 110, top: 37, position: 'absolute', color: '#828282', fontSize: 12, fontFamily: 'SF Pro Display', fontWeight: '400', letterSpacing: 1.20, wordWrap: 'break-word' }}>PROD_MC</div>

        </div>
    )
}

export default Task
